// SPDX-License-Identifier: UNLICENSED
pragma solidity =0.8.24;

// UPGRADEABLE
import {IERC20} from "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import {LibStaking, StakingStorage, UserInfo, PoolInfo} from "../libraries/LibStaking.sol";
import {IStakingFacet} from "../interfaces/IStakingFacet.sol";

/**
 * @title StakingFacet
 * @dev This contract is a facet of Diamond Proxy.
 */
contract StakingFacet is IStakingFacet {
    using SafeERC20 for IERC20; // hmh

    //============================================================================================//
    //                                         Modifiers                                          //
    //============================================================================================//

    modifier validatePool(uint256 poolId) {
        StakingStorage storage s = LibStaking.diamondStorage();
        PoolInfo memory pool = s.poolInfo[poolId];

        if (poolId != s.poolInfo[poolId].poolId) revert PoolDoesNotExist();
        _;
    }

    //============================================================================================//
    //                                     TEST INIT                                              //
    //============================================================================================//

    /// @dev REMOVE THIS FUNCTION, only for testing
    function init() public {
        StakingStorage storage s = LibStaking.diamondStorage();

        address stakeToken = nativeTokenAddress();
        uint256 poolId = _createStakingPool(stakeToken);

        // save test pool in the storage
        s.poolInfo[poolId] = PoolInfo({
            poolId: poolId,
            native: true,
            stakeToken: stakeToken,
            totalStake: 0
        });
    }

    //============================================================================================//
    //                                      Public Functions                                      //
    //============================================================================================//

    /**
     * @notice Main deposit function
     */
    function stakeDeposit(
        uint256 poolId,
        uint256 amount,
        address to
    ) public payable validatePool(poolId) {
        StakingStorage storage s = LibStaking.diamondStorage();

        PoolInfo storage pool = s.poolInfo[poolId];
        UserInfo storage user = s.userInfo[poolId][to];

        // Effects
        user.amount += amount;
        pool.totalStake += amount;

        // Interactions
        if (pool.native) {
            if (msg.value != amount) revert DepositBadValue();
        } else {
            revert Unsupported();
        }

        emit StakeDeposit(msg.sender, poolId, amount, to);
    }

    /**
     * @notice Main withdraw function
     */
    function stakeWithdraw(uint256 poolId, uint256 amount, address to) public validatePool(poolId) {
        StakingStorage storage s = LibStaking.diamondStorage();

        PoolInfo storage pool = s.poolInfo[poolId];
        UserInfo storage user = s.userInfo[poolId][msg.sender];

        // Effects
        user.amount -= amount;
        pool.totalStake -= amount;

        // Interactions
        if (pool.native) {
            (bool success, ) = to.call{value: amount}("");
            if (!success) revert WithdrawFailedCall();
        } else {
            revert Unsupported();
        }

        emit StakeWithdraw(msg.sender, poolId, amount, to);
    }

    // ========= View ========= //

    function userInfo(uint256 poolId, address user) external view returns (UserInfo memory) {
        StakingStorage storage s = LibStaking.diamondStorage();
        return s.userInfo[poolId][user];
    }

    function poolInfo(uint256 poolId) external view returns (PoolInfo memory) {
        StakingStorage storage s = LibStaking.diamondStorage();
        return s.poolInfo[poolId];
    }

    // TODO replace with const or Currency
    function nativeTokenAddress() public pure returns (address) {
        return address(uint160(uint256(keccak256("native"))));
    }

    function generatePoolId(address stakeToken, uint96 idx) public pure returns (uint256) {
        return uint256(keccak256(
            abi.encodePacked(
                stakeToken,
                idx
            )
        ));
    }

    //============================================================================================//
    //                                     Internal Functions                                     //
    //============================================================================================//

    function _createStakingPool(address stakeToken) internal returns (uint256 poolId) {
        StakingStorage storage s = LibStaking.diamondStorage();

        // use current count as idx
        uint96 idx = s.stakeTokenPoolCounts[stakeToken];
        poolId = generatePoolId(stakeToken, idx);

        // increment pool count
        s.stakeTokenPoolCounts[stakeToken]++;

        emit StakingPoolCreate(msg.sender, stakeToken, idx, poolId);
    }
}

contracts/hyperstaking/interfaces/IStaki.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity =0.8.24;

import {UserInfo, PoolInfo} from "../libraries/LibStaking.sol";

/**
 * @title IStakingFacet
 * @dev Interface for StakingFacet
 */
interface IStakingFacet {
    //============================================================================================//
    //                                          Events                                            //
    //============================================================================================//

    event StakeDeposit(
        address indexed from,
        uint256 indexed poolId,
        uint256 amount,
        address indexed to
    );

    event StakeWithdraw(
        address indexed from,
        uint256 indexed poolId,
        uint256 amount,
        address indexed to
    );

    event StakingPoolCreate(
        address indexed from,
        address indexed stakeToken,
        uint256 idx,
        uint256 poolId
    );

    //============================================================================================//
    //                                          Errors                                            //
    //============================================================================================//

    /// @notice Thrown when the provided eth value is incorrect
    error DepositBadValue();

    /// @dev TODO remove
    error Unsupported();

    /// @notice Thrown when failed to transfer ETH value (with call)
    error WithdrawFailedCall();

    /// @notice Thrown when attempting to access a non-existent staking pool
    error PoolDoesNotExist();

    //============================================================================================//
    //                                          Mutable                                           //
    //============================================================================================//

    function init() external;

    function stakeDeposit(uint256 poolId, uint256 amount, address to) external payable;

    function stakeWithdraw(uint256 poolId, uint256 amount, address to) external;


    //============================================================================================//
    //                                           View                                             //
    //============================================================================================//

    function userInfo(uint256 poolId, address user) external view returns (UserInfo memory);

    function poolInfo(uint256 poolId) external view returns (PoolInfo memory);

    function nativeTokenAddress() external pure returns (address);

    function generatePoolId(address stakeToken, uint96 idx) external pure returns (uint256);
}

contracts/hyperstaking/libraries/LibStak.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity =0.8.24;

//================================================================================================//
//                                            Types                                               //
//================================================================================================//

// TODO stakeToken to abstract Currency (which supports both native and erc20)

/**
 * @notice Info of each user
 * @param amount Token amount the user has provided
 */
struct UserInfo {
    uint256 amount;
}

/**
 * @notice Info of each pool
 * @param native Eth
 * @param stakeToken Address of the token that users stake in this pool
 * @param totalStake
 */
struct PoolInfo { // TODO consider again this struct fields
    uint256 poolId; // do we need it here?
    bool native; // hmm
    address stakeToken; // keccak("native"), currency instead?
    uint256 totalStake;
}

//================================================================================================//
//                                           Storage                                              //
//================================================================================================//

struct StakingStorage {
    /// @notice Info of each user that stakes tokens
    mapping (uint256 poolId => mapping (address => UserInfo)) userInfo;

    /// @notice Info of each staking pool
    mapping (uint256 poolId => PoolInfo) poolInfo;

    /// @notice Tracks how many pools have been created for each staking token.
    mapping(address stakeToken => uint96) stakeTokenPoolCounts;
}

library LibStaking {
  bytes32 constant internal STAKING_STORAGE_POSITION = keccak256("hyperstaking-staking.storage");

  function diamondStorage() internal pure returns (StakingStorage storage s) {
    bytes32 position = STAKING_STORAGE_POSITION;
    assembly {
      s.slot := position
    }
  }
}

